    const scores = [
      { scoreSheet: { qualifyingTest: { CA: { percent: 0.75 }, SJ: { percent: 0.60 } } } },
      { scoreSheet: { qualifyingTest: { CA: { percent: 0.50 }, SJ: { percent: 0.50 } } } },
      { scoreSheet: { qualifyingTest: { CA: { percent: 0.25 }, SJ: { percent: 0.40 } } } },
    ];
